import Navbar from "./Components/Navbar";
import Home from "./Components/Home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";

function App() {
  return (
    <Route>
      <Navbar></Navbar>
      <Switch>
        <Route path="/">
          <Home></Home>
        </Route>
      </Switch>
    </Route>
  );
}

export default App;
